import { StyleSheet} from 'react-native';
const infoPageStyles = StyleSheet.create({
    title: {
        fontSize: 20,
        fontWeight: 'bold',
        color:"#FFFFFF"
    },
    separator: {
        marginVertical: 30,
        height: 1,
        width: '80%',
      }, 
    darkblue:{
        backgroundColor: "#1e2833",
    }
});
export {infoPageStyles};
